import React from 'react'
import MakeupProducts from './Product'
import Product from './Product'

function Makeups() {
  return (
    <div className='shop'>
    <div className='shopTitle'>全部商品</div>
    <div>{MakeupProducts.map((product)=><Product data={product} key={product.id}/>)}</div>
</div>
  )
}

export default Makeups
